export function loadScripts() {
  const scriptsUrl = [
  "%PUBLIC_URL%/assets/js/jquery-3.2.1.min.js",
  "%PUBLIC_URL%/assets/js/popper.js",
  "%PUBLIC_URL%/assets/js/bootstrap.min.js",
  "%PUBLIC_URL%/assets/vendors/owl-carousel/owl.carousel.min.js",
  "%PUBLIC_URL%/assets/js/jquery.ajaxchimp.min.js",
  "%PUBLIC_URL%/assets/js/mail-script.js",
  "%PUBLIC_URL%/assets/vendors/bootstrap-datepicker/bootstrap-datetimepicker.min.js",
  "%PUBLIC_URL%/assets/vendors/nice-select/js/jquery.nice-select.js",
  "%PUBLIC_URL%/assets/js/mail-script.js",
  "%PUBLIC_URL%/assets/js/stellar.js",
  "%PUBLIC_URL%/assets/vendors/lightbox/simpleLightbox.min.js",
  "%PUBLIC_URL%/assets/js/custom.js",
  ];
  console.log("hello");
  for (let i = 0; i < 13; i++) {
    const script = document.createElement("script");
    script.async = true;
    script.src = scriptsUrl[i];
    document.getElementsByTagName("head")[0].appendChild(script);
  }
}
